	add("flesh", "{\"term\":\"flesh\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|flesh}}, from Old english (ca. 450-1100) {{m|ang|flǣsc}}, from Proto-germanic {{m|gem-pro|*flaiską}}, from Proto-indo-european {{m|ine-pro|*pleh₁ḱ-||to tear, peel off}}. Compare German {{m|de|Fleisch}}, Low German \u0027fleesch\u0027 West Frisian \u0027fleis\u0027 Dutch \u0027vlees\u0027 Danish \u0027flæsk\u0027 Icelandic \u0027flesk\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The soft tissue of the body, especially muscle and fat\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027, Fannie Farmer, \u0027s:Boston Cooking-School Cook Book/Chapter Boston Cooking-School Cook Book\u0027, Chapter XVII: Poultry and Game\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027flesh\u0027\u0027 of chicken, fowl, and turkey has much shorter fibre than that of ruminating animals, and is not intermingled with fat,—the fat always being found in layers directly under the skin, and surrounding the intestines\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The skin of a human or animal\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Bare arms, bare legs, bare torso\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Animal tissue regarded as food; meat\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Thenne syr launcelot sayd / fader what shalle I do / Now sayd the good man / I requyre yow take this hayre that was this holy mans and putte it nexte thy skynne / and it shalle preuaylle the gretely / syr and I wille doo hit sayd sir launcelot / Also I charge you that ye ete no \u0027\u0027flesshe\u0027\u0027 as longe as ye be in the quest of the sancgreal / nor ye shalle drynke noo wyne / and that ye here masse dayly and ye may doo hit\u0026lt;!--Prior quot\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"I charge the that thou ete no \u0027\u0027fleysshe\u0027\u0027 as longe as ye be in the Queste of Sankgreall, nother ye shall drynke no wyne--\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"c.1530s\u0027\u0027, s:William William Tyndale, \u0027s:Bible Tyndale Bible\u0027, \u0027s:Bible Leviticus\u0027, 7, xix-xxi\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027flesh\u0027\u0027 that twycheth any vnclene thinge shall not be eaten. but burnt with fire:and all that be clene in their flesh, maye eate \u0027\u0027flesh\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Yf any soule eate of the \u0027\u0027flesh\u0027\u0027 of the peaceofferynges, that pertayne vnto the Lorde and hys vnclennesse yet apon him, the same soule shall perisshe from amonge his peoole. \u0026amp;para; Moreouer yf a soule twych any vnclene thinge, whether it be the vnclennesse of man or of any vnclene beest or any abhominacion that is vnclene: ad the eate of the \u0027\u0027flesh\u0027\u0027 of the peaceoffrynges whiche pertayne vnto the Lord, that soule shall perissh from his people\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The human body as a physical entity\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"c.1530s\u0027\u0027, s:William William Tyndale, \u0027s:Bible Tyndale Bible\u0027, \u0027s:Bible Leviticus\u0027, 6, x\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"And the preast shall put on his lynen albe and his lynen breches apon his \u0027\u0027flesh\u0027\u0027, and take awaye the asshes whiche the fire of the burntsacrifice in the altare hath made, and put them besyde the alter\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The mortal body of a human being, contrasted with the spirit or soul\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1769\u0027\u0027, \u0027s:Bible (King King James Bible\u0027, Oxford Standard text, \u0027s:Bible (King Galatians\u0027, 5, xvii\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"For the \u0027\u0027flesh\u0027\u0027 lusteth against the Spirit, and the Spirit against the \u0027\u0027flesh\u0027\u0027: and these are contrary the one to the other: so that ye cannot do the things that ye would\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"1929\u0027\u0027 January, Bassett Morgan (s:Author:Grace Grace Jones), \u0027s:Avon Fantasy Reader/Issue Bimini\u0027, first published in \u0027\u0027, reprinted 1949, in \u0027s:Avon Fantasy Reader/Issue Avon Fantasy Reader, Issue 10\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"But death had no gift for me, no power to free me from \u0027\u0027flesh\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"The evil and corrupting principle working in man\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"The soft, often edible, parts of fruits or vegetables\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Diana Beresford-Kroeger, \u0027Arboretum America: A Philosophy of the Forest\u0027, [http://books.google.com/books?id\u003d7HgjzLERa1kC\u0026amp;pg\u003dPA80\u0026amp;dq\u003dflesh+walnut\u0026amp;hl\u003den\u0026amp;ei\u003d45EyTpb4A4_qmAX9k73wCg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d3\u0026amp;ved\u003d0CDgQ6AEwA\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dflesh%20walnut\u0026amp;f\u003dfalse page 81\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027flesh\u0027\u0027 of black walnuts was a protein-packed winter food carefully hoarded in tall, stilted buildings\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"Tenderness of feeling; gentleness\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"Cowpe\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"There is no \u0027\u0027flesh\u0027\u0027 in man\u0027s obdurate heart\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"Kindred; stock; race\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"Bible, Genesis xxxvii. 2\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"He is our brother and our \u0027\u0027flesh\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"A yellowish pink colour; the colour of some Caucasian human skin\", \"priority\":31}]}, \"synonyms\":{}}");

